import React from 'react';
// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className ="App">

    <input type="text" aria-required="true" size="225" value=""
     name="Search Repo" placeholder="Search Repo" style={{"height" : "1500", "width" : "300" ,"margin": "5px"}}

/>



    <button style={{"height" : "80", "width" : "30"}}>Search</button>


</div>

  );
}

export default App;
